pragma solidity >=0.8.14 <0.9.0;

enum IIGShiftTest {
    NULL,
    ONE,
    TWO,
    THREE,
    FOUR
}
struct IIGLRResult {
    uint256 id;
    uint256 businessId;
    uint256 employeeId;
    uint256 testDate;
    IIGShiftTest shiftTest;
    uint256 expireDate;
    uint256 listeningScore;
    uint256 readingScore;
    uint256 time;
}
struct IIGSWResult {
    uint256 id;
    uint256 businessId;
    uint256 employeeId;
    uint256 testDate;
    IIGShiftTest shiftTest;
    uint256 expireDate;
    uint256 speakingScore;
    uint256 writingScore;
    uint256 time;
}

abstract/Permission.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity >=0.8.17 <0.9.0;

import {Context} from "@openzeppelin/contracts/utils/Context.sol";
import {Ownable} from "./Ownable.sol";

abstract contract Permission is Ownable {
    mapping(address => bool) private approved;

    constructor() Ownable() {}

    function approve() public onlyOwner {
        approved[_msgSender()] = true;
    }

    modifier onlyApproved() {
        _checkApproved();
        _;
    }

    function _checkApproved() internal view {
        require(
            approved[_msgSender()] || _msgSender() == owner(),
            "Permission: only approved"
        );
    }
}

